import DIRECTORY_DATA from './directory.data';
const INITIAL_STATE = {
    directory: DIRECTORY_DATA
}

const directoryReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        default:
            return state
    }

}

export default directoryReducer
